import { Props } from './Alies';

type Props2 =  Props & {
  value1: string;
  value2: string;
};

const Recierver:React.FC<Props2> = ({register,value1,value2})=> {
    if(value1 === "Pass" && value2 === "Complete"){
        return (
          <>
              <div className="mx-2 mt-2"><h5>Reciever</h5></div>
                  <select {...register("reciever")} className="col-10 col-sm-3">
                      <option value="-">-</option>
                      <option value="11">11</option>
                      <option value="18">18</option>
                  </select>
          </>
        )
      }
      return null


    }


export default Recierver
